query:
mutation sitesRemoveIpsecIkeV2SiteTunnels ( $accountId:ID! $siteId:ID! $removeIpsecIkeV2SiteTunnelsInput:RemoveIpsecIkeV2SiteTunnelsInput!) {
	sites ( accountId:$accountId ) {
		removeIpsecIkeV2SiteTunnels ( siteId:$siteId  input:$removeIpsecIkeV2SiteTunnelsInput  )  {
			siteId
			primary {
				fqdn
				tunnels {
					tunnelId
					localId
				}
			}
			secondary {
				fqdn
				tunnels {
					tunnelId
					localId
				}
			}
		}
	}	
}
